                "epoch": "2005-06-30",
                "altitude": null,
                "comment": "In addition to a previous event just four weeks before, on 30 June, Satellite Number 27474 experienced another fragmentation. This time more than 50 debris were cataloged prior to decay. Interestingly, the other auxiliary motor (International Designator 2002-37F, U.S. Satellite Number 27475) for the Cosmos 2392 mission experienced a fragmentation in October 2004 (Orbital Debris Quarterly News, 9-1, p. 2). The fragmentations of 2002-37E and 2002-37F are the only known events for Proton Block DM auxiliary motors that were launched after 1996.",
