            "attributes": {
                "eventType": "Meteor Class",
                "epoch": "2005-06-21",
                "altitude": null,
                "comment": "This satellite fragmentation occurred on 21 June 2005. Meteor 2-17 (International Designator 1988-5A, U.S. Satellite Number 18820) generated one small piece of debris in an apparent lowenergy incident, normally referred to as an anomalous event. The piece exhibited a very low separation velocity from the Russian spacecraft, which was in an orbit of approximately 930 km by 960 km, with inclination near 82.5 at the time of the event.",
